demo.repl.help:
Tilgængelige kommandoer:
  @show              ─ vis den seneste oversigt over adaptive card
  @json              ─ udskriv den rå JSON-værdi modtaget fra flowet
  @back              ─ vend tilbage til det forrige blokerede kort/input
  @input <k>=<v>     ─ sæt eller tilsidesæt et inputfelt
  @click <action_id> ─ send kortet med den angivne handling
  @help              ─ udskriv denne hjælpetekst
  @quit              ─ afslut REPL
